import React, { useEffect, useState } from 'react';
import { motion } from 'framer-motion';
import { FaGithub, FaLinkedin, FaTwitter, FaEnvelope, FaHeart } from 'react-icons/fa';
import ProjectCard from '../components/ProjectCard';
import axios from 'axios';

// Typewriter component
const Typewriter = ({ text, speed = 75, className = "" }) => {
  const [displayText, setDisplayText] = useState('');
  const [currentIndex, setCurrentIndex] = useState(0);

  useEffect(() => {
    if (currentIndex < text.length) {
      const timeout = setTimeout(() => {
        setDisplayText(prev => prev + text[currentIndex]);
        setCurrentIndex(prev => prev + 1);
      }, speed);
      return () => clearTimeout(timeout);
    }
  }, [currentIndex, text, speed]);

  return (
    <span className={className}>
      {displayText}
      <span className="animate-pulse">|</span>
    </span>
  );
};

// Animated Text Component
const AnimatedText = ({ text, className = "" }) => {
  return (
    <h1 className={`text-6xl font-bold text-white ${className}`}>
      {text.split('').map((char, index) => (
        <span
          key={index}
          className={`inline-block transition-all duration-500 ease-out group-hover:animate-pulse ${
            index % 4 === 0 
              ? 'group-hover:-translate-y-4 group-hover:translate-x-2 group-hover:rotate-6' 
              : index % 4 === 1
              ? 'group-hover:translate-y-3 group-hover:-translate-x-3 group-hover:-rotate-8'
              : index % 4 === 2
              ? 'group-hover:-translate-y-2 group-hover:translate-x-4 group-hover:rotate-4'
              : 'group-hover:translate-y-4 group-hover:-translate-x-2 group-hover:-rotate-6'
          }`}
          style={{ animationDelay: `${index * 0.1}s` }}
        >
          {char === ' ' ? '\u00A0' : char}
        </span>
      ))}
    </h1>
  );
};

const Home = () => {
  const [featuredProjects, setFeaturedProjects] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchFeaturedProjects = async () => {
      try {
        const response = await axios.get('/api/projects/featured');
        setFeaturedProjects(response.data);
      } catch (error) {
        console.error('Error fetching featured projects:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchFeaturedProjects();
  }, []);

  // Custom cursor functionality
  useEffect(() => {
    const nameElement = document.querySelector('.custom-cursor');
    if (nameElement) {
      const handleMouseEnter = () => {
        document.body.style.cursor = `url('/cursor.png'), auto`;
      };
      
      const handleMouseLeave = () => {
        document.body.style.cursor = 'auto';
      };

      nameElement.addEventListener('mouseenter', handleMouseEnter);
      nameElement.addEventListener('mouseleave', handleMouseLeave);

      return () => {
        nameElement.removeEventListener('mouseenter', handleMouseEnter);
        nameElement.removeEventListener('mouseleave', handleMouseLeave);
      };
    }
  }, []);

  const skills = [
    'React', 'Node.js', 'MongoDB', 'JavaScript', 'TypeScript', 'Python',
    'Tailwind CSS', 'Express.js', 'Git', 'Docker', 'AWS', 'PostgreSQL'
  ];

  return (
    <div className="min-h-screen">
      {/* Hero Section */}
      <section className="section-padding bg-white">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            className="text-center"
          >
            <h1 className="text-4xl md:text-6xl font-bold text-gray-900 mb-6 font-playwrite">
            Hi, I'm
              <Typewriter 
                text="Prince Sharma" 
                speed={150}
                className="relative group inline-block custom-cursor text-5xl md:text-6xl mb-6 font-bold text-gray-900 font-playwrite"
              />
            </h1>
            <p className="text-xl md:text-2xl text-gray-600 mb-8 max-w-3xl mx-auto font-playwrite">
              Full Stack Developer passionate about creating beautiful and functional web applications
            </p>
            <div className="flex justify-center space-x-4 mb-8">
              <a
                href="http://github.com/prince0k"
                target="_blank"
                rel="noopener noreferrer"
                className="text-gray-600 hover:text-primary-600 transition-colors duration-200"
              >
                <FaGithub size={24} />
              </a>
              <a
                href="https://www.linkedin.com/in/prince-sharma"
                target="_blank"
                rel="noopener noreferrer"
                className="text-gray-600 hover:text-primary-600 transition-colors duration-200"
              >
                <FaLinkedin size={24} />
              </a>
              <a
                href="https://x.com/princes65258114"
                target="_blank"
                rel="noopener noreferrer"
                className="text-gray-600 hover:text-primary-600 transition-colors duration-200"
              >
                <FaTwitter size={24} />
              </a>
              <a
                href="mailto:prince4sharmaa123@gmail.com"
                className="text-gray-600 hover:text-primary-600 transition-colors duration-200"
              >
                <FaEnvelope size={24} />
              </a>
            </div>
            <div className="flex flex-col sm:flex-row gap-4 justify-center font-playwrite">
              <a href="/projects" className="btn-primary">
                View My Work
              </a>
              <a href="/contact" className="btn-secondary">
                Get In Touch <FaHeart className="inline text-red-500 mx-2 my-2" />
              </a>
            </div>
          </motion.div>
        </div>
      </section>

      {/* About Section */}
      <section className="section-padding">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
            className="grid md:grid-cols-2 gap-12 items-center"
          >
            <div>
              <h2 className="text-3xl font-bold text-gray-900 mb-6 font-playwrite">About Me</h2>
              <p className="text-lg text-gray-600 mb-6 font-playwrite">
                I'm a passionate full-stack developer with experience in building modern web applications. 
                I love solving complex problems and creating user-friendly interfaces that make a difference.
              </p>
              <p className="text-lg text-gray-600 mb-6 font-playwrite">
                With expertise in React, Node.js, and MongoDB, I specialize in creating scalable and 
                maintainable applications that deliver exceptional user experiences.
              </p>
              <div className="flex flex-wrap gap-2">
                {skills.map((skill, index) => (
                  <span
                    key={index}
                    className="bg-gray-100 text-gray-700 px-3 py-1 rounded-full text-sm font-medium"
                  >
                    {skill}
                  </span>
                ))}
              </div>
            </div>
            <div className="relative group overflow-hidden rounded-lg h-96 bg-cover bg-center bg-no-repeat shadow-2xl transform transition-all duration-500 hover:scale-105 hover:shadow-3xl">
              {/* Background Image */}
              <div 
                className="absolute inset-0 bg-cover bg-center bg-no-repeat"
                style={{
                  backgroundImage: `url('https://images.unsplash.com/photo-1506905925346-21bda4d32df4?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2070&q=80')`
                }}
              ></div>
              
              {/* Dark Overlay */}
              <div className="absolute inset-0 bg-black bg-opacity-50 transition-all duration-300 group-hover:bg-opacity-30"></div>
              
              {/* Animated Text */}
              <div className="absolute inset-0 flex items-center justify-center">
                <AnimatedText 
                  text="Prince Sharma" 
                  className="group cursor-pointer select-none"
                />
              </div>
              
              {/* Glow Effect */}
              <div className="absolute inset-0 bg-gradient-to-r from-transparent via-white to-transparent opacity-0 group-hover:opacity-20 transition-opacity duration-500 transform -skew-x-12"></div>
            </div>
          </motion.div>
        </div>
      </section>

      {/* Featured Projects Section */}
      <section className="section-padding bg-gray-50">
        <div className="container-max">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
            className="text-center mb-12"
          >
            <h2 className="text-3xl font-bold text-gray-900 mb-4 font-playwrite">Featured Projects</h2>
            <p className="text-lg text-gray-600 max-w-2xl mx-auto font-playwrite ">
              Here are some of my recent projects that showcase my skills and passion for development.
            </p>
          </motion.div>

          {loading ? (
            <div className="text-center">
              <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-600 mx-auto"></div>
            </div>
          ) : (
            <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
              {featuredProjects.slice(0, 3).map((project, index) => (
                <motion.div
                  key={project._id}
                  initial={{ opacity: 0, y: 20 }}
                  whileInView={{ opacity: 1, y: 0 }}
                  transition={{ duration: 0.6, delay: index * 0.1 }}
                  viewport={{ once: true }}
                >
                  <ProjectCard project={project} />
                </motion.div>
              ))}
            </div>
          )}

          <motion.div
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.3 }}
            viewport={{ once: true }}
            className="text-center mt-12"
          >
            <a href="/projects" className="btn-primary font-playwrite">
              View All Projects
            </a>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default Home;
